import React from 'react';

class Level extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      time: '',
    };
  }

  componentDidMount() {
    fetch(`https://api.nike.com/deliver/available_skus/v1/${this.props.props}`)
      .then((res) => res.json())
      .then((json) => {
        console.log(json);
      });
  }
  render() {
    return <p>fff</p>;
  }
}

export default Level;
